import React, { Component } from 'react';
import { useEffect, useState } from 'react';
import { useDispatch, useSelector } from "react-redux";
import { selectUser } from "./features/userSlice";
import { useNavigate } from "react-router-dom";


import ReactDOM from 'react-dom';
// import ReactPaginate from 'react-paginate';

function GetUsers({ itemsPerPage }) {
  const axios = require('axios');
  const [js, setjs] = useState([]);
  const [val, setval] = useState('');
  let navigate = useNavigate();
  const loggedout = (e) => {
    dispatch(logout());
    navigate('/login');
  };
  const dispatch = useDispatch();
  const user = useSelector(selectUser);
  useEffect(() => {
    axios.get('http://localhost:8000/api/users', {
      headers:
      {
        'Authorization': "Bearer " + user.verifytoken
      }
    })
      .then(function (response) {
        setjs(response.data);
      })
  }, []);

  return (
    <div>
      <div className='navbary'>
        <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
          <a className="navbar-brand" href="#"><em>&nbsp;&nbsp;DeMock</em></a>
          {/* <button className="navbar-toggler" type="button" dataToggle="collapse" data-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
          </button> */}
          {/* <div className="collapse navbar-collapse" id="navbarNavAltMarkup"> */}
          <div className="navbar-nav">
            <p className="dis disabled" style={{ color: "white" }}>Dashboard</p>
            <button className="allUsers nav-item nav-link active" onClick={(e) => { navigate('/getallusers') }}><span style={{ color: "white" }}>Show All Users</span></button>
            <button className="myTasks nav-item nav-link" onClick={(e) => { navigate('/gettasks') }}><span style={{ color: "white" }}>List Tasks</span></button>
            <button className="crtTasks nav-item nav-link" onClick={(e) => { navigate('/create/task') }}><span style={{ color: "white" }}>Create Task</span></button>
            <button className="logout nav-item nav-link" onClick={(e) => loggedout(e)}><span style={{ color: "white" }}>Logout</span></button>
          </div>
          {/* </div> */}
        </nav>
      </div>


      <input className='search' onChange={(e) => { e.preventDefault(); const finalval = e.target.value; setval(finalval); }} type="text" placeholder="Search" value={val} />
      <table>
        <tr>
          <td>Id</td>
          <td>Name </td>
          <td>Email</td>
          <td>Role</td>
        </tr>
        {js.filter(post => {

          if (val === '') {
            return post;
          } else if (post.name.toLowerCase().includes(val.toLowerCase())) {
            return post;
          }
          else if (post.email.toLowerCase().includes(val.toLowerCase())) {
            return post;
          }
          else if (post.role.toLowerCase().includes(val.toLowerCase())) {
            return post;
          }
        }).map((item) => {
          return (
            <tr key={item.id}>
              <th>{item.id}</th>
              <th>{item.name} </th>
              <th>{item.email}</th>
              <th>{item.role}</th>
            </tr>

          )
        })}
      </table>
    </div>
  )
}

export default GetUsers;
